import React from 'react';
import Series from '../../containers/series';
import './index.css'

const SeriesListItem = props => {
    <li key={series.show.id}>
        {series.show.name}
    </li>
}

const SeriesList = (props) => {
    return (
        <div>
            <ul className="series-list">
                {props.list.map(series =>(
                    <SeriesListItem/>
                ))}
            </ul>
        </div>
    )
}

export default SeriesList;
